sidebarCSS:
#root.root {
    --ntb-border-radius: 0.5em;
}

#root.root {
    --tabs-indent: 0px;
}

#root.root {
    --general-border-radius: 4px;
}

#root.root {
    --toolbar-bg: #11111b;
}

#root.root {
    --frame-bg: #11111b;
}

#root.root {
    --tabs-height: 32px;
}

#root.root {
    --tabs-margin: 6px;
}

#root.root {
    --pinned-tabs-col: 4;
}

#root.root {
    flex-direction: column-reverse;
}

.NavigationBar {
    transition: all ease-in-out 200ms;
}

.NavigationBar .main-items {
    gap: var(--tabs-margin);
    margin: 0;
    justify-content: start;
}

.NavigationBar .main-items .nav-item {
    flex: 1 !important;
    margin: 0 !important;
    padding: 0 !important;
    border-radius: 0.5em !important;
}

.NavigationBar .main-items .nav-item[data-active='false'] {
    display: none;
}

.NavigationBar .main-items .nav-item[data-active='true'] {
    border: 0 !important;
    box-shadow: none !important;
    outline: none !important;
    background: #1e1e2e !important;
    background-color: #1e1e2e !important;
}

.Tab {
    margin: var(--tabs-margin);
}

.Tab .color-layer {
    opacity: 0.2 !important;
    border-radius: 0.5em !important;
    border: 0 !important;
}

.Tab .audio,
.Tab .title {
    opacity: 0 !important;
    transition: ease-in-out 250ms;
}

.Tab .title {
    background-clip: text;
}

.Tab[data-active='true'] .color-layer {
    opacity: 0.6 !important;
    border-radius: 0.5em !important;
}

.Tab[data-pin='false'] .fav,
.Tab[data-pin='false'] .fav-icon {
    width: 18px;
    height: 18px;
    position: relative;
    left: 50%;
    transform: translateX(-50%);
    margin: 0;
}

.Tab[data-pin='true'] .fav,
.Tab[data-pin='true'] .fav-icon {
    width: 20px;
    height: 20px;
}

.Tab[data-pin='false'][data-active='true'] .body {
    border: 0;
    box-shadow: none;
    background: transparent;
}

.Tab[data-pin='true'][data-active='true'] .body {
    border: 0;
    box-shadow: none;
    background: transparent;
}

.BottomBar {
    display: none;
}

@media screen and (min-width: 350px) {
    #root.root {
        --tabs-pinned-height: 40px;
    }

    #root.root {
        --tabs-pinned-width: calc(
            (100vw - (var(--tabs-margin) * (var(--pinned-tabs-col) + 1))) /
                var(--pinned-tabs-col)
        );
    }

    #root.root {
        --tabs-indent: 14px;
    }

    .NavigationBar .main-items .nav-item[data-active='false'] {
        display: flex;
    }

    .BottomBar {
        display: flex;
    }

    .Tab .audio,
    .Tab .title {
        opacity: 1 !important;
        margin: 0 var(--tabs-margin);
    }

    .Tab[data-pin='false'] .fav,
    .Tab[data-pin='false'] .fav-icon {
        position: static;
        left: 0;
        transform: translateX(0%);
    }

    .Tab[data-pin='false'] .fav {
        margin-right: var(--tabs-margin);
    }

    .Tab[data-pin='false'] .fav-icon {
        margin: 0 var(--tabs-margin);
    }
}
